import React, {FC} from 'react';
import { PlatformTypes, platformToText } from '../models/platform_enums';
import '../styles/buttons.css';
import appleLogo from '../assets/appleLogo.png'

interface Props {
    platform: PlatformTypes;

}

const PlatformButtons: FC<Props> = (props) => {
    return (
        <div className="Button-outline" key={props.platform}>
            <a>Download on {platformToText.get(props.platform)}</a>
            <img src={appleLogo}/>
        </div> 
    );
}

export default PlatformButtons;
